import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import React from 'react';
import CarouselFadeExample from './carousel';
import './App.css';
import DisplayHomeImg from './homephoto';
import { useNavigate } from 'react-router-dom';
import MyComponent from './mycomponent';

// import './appjavascript';
// import TheCalendar from './calendar';


//ok


let testButton = document.getElementById("test-button");
testButton.addEventListener("click", ()=>{
  fetch('http://localhost:8080/api/contact-requests')
  .then(response => {
    if (!response.ok) {
      throw new Error('Network response was not ok');
    }
    return response.json();
  })
  .then(data => {
    // console.log(data); // Handle the data as needed
    console.log(JSON.stringify(data, null, 2)); // Pretty-print JSON with 2-space indentation
  })
  .catch(error => {
    console.error('There was a problem with the fetch operation:', error);
  });

})

// let prayerRequestNavButton = document.getElementById("pr");
// prayerRequestNavButton.addEventListener("click", () => {
// const navigate = useNavigate();
// navigate("/contactusPage");
// })



function App() {
  const navigate = useNavigate();

  return (
    <>

    <Navbar expand="lg" className="bg-body-tertiary" class="nav" data-bs-theme="dark">
    <Container>
      <Navbar.Brand href="#home">Iglesia Voz de Dios</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="me-auto">
          <Nav.Link href="#home">Home</Nav.Link>
          <Nav.Link href="#link">About Us</Nav.Link>
          <Nav.Link href="#link">Mission</Nav.Link>
          <Nav.Link href="#link">Events</Nav.Link>
          <Nav.Link href="#link" id="pr" onClick={() => navigate("/contactusPage.html")}
>Prayer Request</Nav.Link>
          <NavDropdown title="Contact Us" id="basic-nav-dropdown">
            <NavDropdown.Item href="#action/3.1">E-Mail</NavDropdown.Item>
            <NavDropdown.Item href="#action/3.2">
              Another action
            </NavDropdown.Item>
            <NavDropdown.Item href="#action/3.3">Send Message</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="#action/3.4">
              Separated link
            </NavDropdown.Item>
          </NavDropdown>
        </Nav>
      </Navbar.Collapse>

    </Container>
  </Navbar> 
  <div id="wholepage">

    <div id="top-page">
  <h1 id="titleh1">Iglesia Voz de Dios</h1>
  <h3>Pastor Roberto Castro</h3>
  <button id="test-button">Get All Prayer Requests</button>


  <DisplayHomeImg/>

  <div id="caro">

      </div>
      </div>


    <div id="middle-page">
      <div id="middle-left">
       <h4>Visit our location</h4>
       <p>1530 4th Ave Folsom, PA 19033</p>
       <h4>Service Hours</h4>
       <ul>
        <li>Sunday 3:30PM - Main Service</li>
        <li>Wednesday 7:30PM - Prayer</li>
       </ul>
       <h4>Social Networks:</h4>
       <ul>
        <li><a href="">Youtube</a></li>
        <li><a href="">Facebook</a></li>
        <li><a href="">Instagram</a></li>
        <li><a href="">TikTok</a></li>
       </ul>

      </div>
      <div id="middle-middle">
      <Container className="mt-3">
        <CarouselFadeExample />
      </Container>
      </div>
      <div id="middle-right">

        <h2>hi</h2>
      </div>
      </div>

      </div>
  </>

);
}

export default App;
